    public static long howManyTimes(String string, String substring) {
        int sLen = string.length();
        int subLen = substring.length();
        if (sLen == 0 || subLen == 0 || subLen > sLen)
            return 0;
        if (sLen == subLen)
            return 1;
        int total = sLen - subLen + 1;
        int[][] count = new int[total][subLen];
        for (int i = 0; i < total; i++) {
            for (int j = 0; j < subLen; j++) {
                if (i == 0) {
                    if (string.charAt(i + j) == substring.charAt(j))
                        count[i][j] = 1;
                    else
                        count[i][j] = 0;
                } else {
                    if (count[i][j] == 1 && string.charAt(i + j) == substring.charAt(j))
                        count[i][j]++;
                }
            }
        }
        return Stream.of(count).map(r -> Arrays.stream(r)).flatMap(v -> v).mapToLong(i -> i).sum();

